import React from "react";
import "./Hero.css";
const Hero = () => {
  return (
    <main>
      <div className="hero_sec">
        <div className="hero_inner">
          <div className="buy_car">
            <h2 style={{ background: "#e0ebff" }}>Buy used cars</h2>
          </div>
          <div className="sell_car">
            <h2 style={{ background: "#053d66" }}>Sell your car</h2>
          </div>
        </div>
      </div>
    </main>
  );
};

export default Hero;
